import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

import "./App.css";

import Navbar from '../components/Navbar/Navbar';
import Home from '../components/Home/Home';


function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Navbar title="Magical travels"/>
        <Route exact path="/" render={() => <Home title="" />} />


      </div>
    </BrowserRouter>
  );
}

export default App;
